import React from "react";

const ProgressBar = () => {


    return(
        <section className="progress_container">
            <ul>
                <section >
                    <li className="prog_part" >
                            1
                        <span className="prog_desc">Booking details</span>
                    </li>
                </section>
            </ul>
        </section>
    )
}
export default ProgressBar
